import React from "react";
import { useParams } from "react-router-dom";

const CoinDetails = ({ coins }) => {
  const { id } = useParams();
  const coinsId = [];

  coins.map((coin, index) => {
    coinsId.push(coin.id);
  });

  console.log(coinsId);

  return (
    <>
      {coins
        .filter((coin) => coin.id === id)
        .map((result) => (
          <>
            <h1>CoinDetails: {result.id}</h1>
          </>
        ))}
    </>
  );
};

export default CoinDetails;
